import React from "react";
import { Text, View, TouchableOpacity, Image, StyleSheet } from "react-native";
import './alarm.css';

const Alarm = () => {
  return (
      <View className="wrapper">
        <Text style={{}}>Alarm</Text>
      </View>
  );
};
export default Alarm;
